■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>うるおいたっぷり濃密オイルで、しっかりメイクもスッキリ!!</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5401/1062203-01.jpg" width="600" height="600"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">【使用方法】<br>洗顔の前に、手や顔をぬらさずにお使いください。オイルを乾いた手のひらに2～3プッシュ取り、お顔全体にのばして優しくマッサージするようにメイクとよくなじませます。汚れが浮き上がったら、水またはぬるま湯でしっかりすすぎます。<br><br>【使用上の注意】<br>※傷やはれもの、湿疹等の異常がある部分には使用しないでください。<br>※化粧品が肌に合わないとき、また次のような場合には使用を中止してください。<br>(1)使用中、赤み・はれ・かゆみ・刺激等の異常があらわれた場合。<br>(2)使用した肌に直射日光があたって上記のような症状があらわれた場合。<br>そのまま使用を続けると症状を悪化させることがありますので、専門医へのご相談をおすすめします。<br><br>【保管方法】<br>※極端に高温や低温の場所、直射日光のあたる場所には保管しないでください。<br>※乳幼児の手の届かない場所に保管してください。</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">オリーブ油とホホバ油を配合した、肌にやさしい洗い流し専用のオイルクレンジングです。密着性の高いメイクにもすばやくなじみ、毛穴の皮脂もしっかり落とします。オイルなのにサラッとなめらかな感触で、洗い上がりはさっぱりとしていながらしっとりとしたお肌に仕上げます。</font></td></tr></table><br><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><p><table width="300" border="0" cellspacing="0" cellpadding="0">  <tr>  <td>  <font color="#333333" size="-1">オリーブ油とホホバ油を配合した、肌にやさしい洗い流し専用のオイルクレンジングです。密着性の高いメイクにもすばやくなじみ、毛穴の皮脂もしっかり落とします。オイルなのにサラッとなめらかな感触で、洗い上がりはさっぱりとしていながらしっとりとしたお肌に仕上げます。</font>  </td>  </tr>  </table>  <br>  <table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666">  <tr bgcolor="#FFFFFF">  <td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td>  <td width="75%" align="left"><font color="#333333" size="-1">150ml</font></td>  </tr>  <tr bgcolor="#FFFFFF">  <td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td>  <td align="left">  <font color="#333333" size="-1">個装サイズ：5×5×17cm</font>  </td>  </tr>  <tr bgcolor="#FFFFFF">  <td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td>  <td align="left">  <font color="#333333" size="-1">個装重量：200g</font>  </td></tr></p><p><tr bgcolor="#FFFFFF">  <td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td>  <td align="left">  <font color="#333333" size="-1">商品区分：化粧品</font><br>  <font color="#333333" size="-1">メーカー名：エーエフシー</font><br>  </td>  </tr>  <tr bgcolor="#FFFFFF">  <td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">成分</font></td>  <td align="left"><font color="#333333" size="-1">パルミチン酸エチルヘキシル、コメヌカ油、テトラオレイン酸ソルベス-30、オリーブ油、トリイソステアリン酸PEG-20グリセリル、ホホバ油、ティーツリー油、トコフェロール</font></td>  </tr>  <tr bgcolor="#FFFFFF">  <td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td>  <td align="left"><font color="#333333" size="-1">日本</font></td>  </tr>  </table></p><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
